import styled from "styled-components";

function SectionProject() {
  return (
    <Container>
      <Wrap>
        <TextBannerWrap>
          <TextBanner>
            <div>KEEP GOING</div>
          </TextBanner>
        </TextBannerWrap>
      </Wrap>
    </Container>
  );
}

export default SectionProject;
